import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import Hero from './components/Hero';
import Achievement from './components/Achievement';
import Whatcompanyoffers from './components/Whatcompanyoffers';

function App() {
  return (
    <div className="App">
      <Header />
      <Hero />
      <Achievement />
      <Whatcompanyoffers />
    </div>
  );
}

export default App;
